import { ToggleButtonGroup, ToggleButton, FormText } from "react-bootstrap";

const GridLayout = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
`;

function HomeContet() {
  return (
    <div>
      <GridLayout>
        <div>item</div>
        <div>item</div>
        <div>item</div>
        <div>item</div>
        <div>item</div>
        <div>item</div>
        <div>item</div>
        <div>item</div>
      </GridLayout>
    </div>
  );
}

export default HomeContet;
